import React, { Component } from 'react';
import PropsType, { object } from 'prop-types';
import {connect} from 'react-redux';
import { getCurrentProfile } from '../../actions/profileActions';
import Spinner from '../common/Spinner';
import { Link } from 'react-router-dom';
class Dashboard extends Component {

    componentDidMount() {
        this.props.getCurrentProfile()
    }
    render() {

        const {user } =this.props.auth;
        const {profile,loading} =this.props.profile;

        let dashboardContent;

        if(profile === null ||loading ) {
            dashboardContent =<Spinner />
        } else {
            if(object.keys(profile).length > 0) {
                dashboardContent =
                <h4>Dispaly profile</h4>
            } else {
                dashboardContent =(
                    <div>
                        <p className="lead text-muted"> Welcom {user.name}</p>
                        <p >you have not yet profile please more add the info</p>
                        <Link className="btn btn-lg btn-info" >Create </Link>
                    </div>
                )
            }
        }
        

        return (
            <div className="dashboard">
                <div className="container">

                    <div className="row">
                        <div className="col-md-12">
                            <h1 className="display-4"> Dashboard
                            {dashboardContent}
                            </h1>
                        </div>
                    </div>

                </div>
                
            </div>
        )
    }
}
Dashboard.propTypes={

    getCurrentProfile:PropsType.func.isRequired,
    auth:PropsType.object.isRequired,
    profile:PropsType.object.isRequired
}
const mapStateToProps =state =>({
    profile:state.profile,
    auth:state.auth
})
export default  connect(mapStateToProps,{getCurrentProfile})(Dashboard);
